import PackageImporter from './lib/PackageImporter.js';

const packageImporter = new PackageImporter();
/**
 * Package importer for node-sass
 * @param {string} url - The path in import as-is, which LibSass encountered.
 * @param {string} prev - The previously resolved path.
 * @param {Function} done - A callback function to invoke on async completion.
 */
export default function (url, prev, done) {
  if (this.options.packageImporter) {
    Object.assign(packageImporter.options, this.options.packageImporter);
  }
  packageImporter.resolve(url).then(file => done(file ? { file } : null));
}

import resolve from 'resolve';
import path from 'path';

/**
 * Import packages from the `node_modules` directory.
 */
export default class PackageImporter {
  /**
   * @param {Object} options - Configuration options.
   */
  constructor(options = {}) {
    const defaultOptions = {
      cwd: process.cwd(),
      extensions: [
        '.scss',
        '.sass'
      ],
      packageKeys: [
        'sass',
        'scss',
        'style',
        'css',
        'main.sass',
        'main.scss',
        'main.style',
        'main.css',
        'main'
      ]
    };
    /** @type {Object} */
    this.options = Object.assign({}, defaultOptions, options);
  }

  /**
   * Synchronously resolve the path to a node-sass import url.
   * @param {string} url - Import url from node-sass.
   * @return {string} Fully resolved import url or null.
   */
  resolveSync(url) {
    const cleanUrl = this.cleanUrl(url);
    const urlVariants = this.urlVariants(cleanUrl);
    let file = null;
    // Find a url variant that can be resolved.
    urlVariants.some(urlVariant => {
      try {
        const resolvedPath = resolve.sync(urlVariant, {
          basedir: this.options.cwd,
          packageFilter: pkg => this.resolveFilter(pkg),
          extensions: this.options.extensions
        });
        if (resolvedPath) {
          file = resolvedPath;
          return true;
        }
      } catch (e) {}
      return false;
    });
    return file;
  }

  /**
   * Asynchronously resolve the path to a node-sass import url.
   * @param {string} url - Import url from node-sass.
   * @return {Promise} Promise for a fully resolved import url.
   */
  resolve(url) {
    return new Promise((promiseResolve) => {
      promiseResolve(this.resolveSync(url));
    });
  }

  /**
   * Clean a node sass import url.
   * @param {string} url - Import url from node-sass.
   * @return {string} Cleaned url.
   */
  cleanUrl(url) {
    // Remove tilde symbol from the beginning
    // of urls (except home "~/" directory).
    const re = new RegExp(`^~(?!${path.sep})`);
    return url.replace(re, '');
  }

  /**
   * Create url variants for partial file matching (e.g. _file.scss).
   * @param {string} url - Import url from node-sass.
   * @return {Array} Multiple variants of sass file names.
   */
  urlVariants(url) {
    const parsedUrl = path.parse(url);
    let urlVariants = [url];
    if (parsedUrl.dir && !parsedUrl.ext) {
      urlVariants = this.options.extensions.reduce((x, extension) => {
        x.push(path.join(parsedUrl.dir, `${parsedUrl.name}${extension}`));
        x.push(path.join(parsedUrl.dir, `_${parsedUrl.name}${extension}`));
        return x;
      }, urlVariants);
    }
    return urlVariants;
  }

  /**
   * Find the first matching key in a package.json file
   * and set it as value for the `main` field.
   * @param  {Object} pkg - Contents of a package.json.
   * @return {Object} A package.json object with a replaced main value.
   */
  resolveFilter(pkg) {
    const newPkg = pkg;
    const pkgKey = this.options.packageKeys.find(x => pkg[x] !== undefined);
    newPkg.main = pkg[pkgKey];
    return newPkg;
  }
}

/* eslint-env node, mocha */
/* eslint-disable no-console */
const chai = require('chai');
const chaiAsPromised = require('chai-as-promised');
const expect = require('chai').expect;
const fs = require('fs');
const sass = require('node-sass');
const path = require('path');

const packageImporter = require('../');
const PackageImporterClass = require('../dist/PackageImporter.js');

chai.use(chaiAsPromised);

/** @test {index} */
describe('packageImporter', () => {
  it('should be a function', () => expect(packageImporter).to.be.a('function'));

  it('should resolve module import', (done) => {
    const expectedResult = fs.readFileSync('test/files/module-reference.css', {
      encoding: 'utf8'
    });
    sass.render({
      file: 'test/files/module.scss',
      importer: packageImporter
    }, (error, result) => {
      if (!error) {
        expect(result.css.toString()).to.equal(expectedResult);
        done();
      } else {
        console.log(error);
      }
    });
  });
});

/** @test {PackageImporter} */
describe('PackageImporter', () => {
  it('should be a function', () => expect(PackageImporterClass).to.be.a('function'));

  /** @test {PackageImporter#resolveSync} */
  describe('resolveSync()', () => {
    it('should be a function', () => {
      const packageImporterInstance = new PackageImporterClass();
      return expect(packageImporterInstance.resolveSync).to.be.a('function');
    });
  });

  /** @test {PackageImporter#resolve} */
  describe('resolve()', () => {
    it('should be a function', () => {
      const packageImporterInstance = new PackageImporterClass();
      return expect(packageImporterInstance.resolve).to.be.a('function');
    });

    it('should return null', (done) => {
      const packageImporterInstance = new PackageImporterClass();
      const url = 'path/that/does/not/exist.scss';
      const expectedResult = null;
      return expect(packageImporterInstance.resolve(url))
        .to.eventually.equal(expectedResult)
        .notify(done);
    });

    it('should return url for the test-module main sass file', (done) => {
      const options = { cwd: path.join(process.cwd(), 'test/files') };
      const packageImporterInstance = new PackageImporterClass(options);
      const url = 'test-module';
      const expectedResult = `${path.join(
        options.cwd,
        'node_modules/test-module/scss/style.scss'
      )}`;
      return expect(packageImporterInstance.resolve(url))
        .to.eventually.equal(expectedResult)
        .notify(done);
    });

    it('should return url for the test-module partial file', (done) => {
      const options = { cwd: path.join(process.cwd(), 'test/files') };
      const packageImporterInstance = new PackageImporterClass(options);
      const url = 'test-module/scss/partial';
      const expectedResult = `${path.join(
        options.cwd,
        'node_modules/test-module/scss/_partial.scss'
      )}`;
      return expect(packageImporterInstance.resolve(url))
        .to.eventually.equal(expectedResult)
        .notify(done);
    });
  });

  /** @test {PackageImporter#cleanUrl} */
  describe('cleanUrl()', () => {
    it('should be a function', () => {
      const packageImporterInstance = new PackageImporterClass();
      return expect(packageImporterInstance.cleanUrl).to.be.a('function');
    });

    it('should return the url unmodified', () => {
      const packageImporterInstance = new PackageImporterClass();
      const url = 'normal/path/without/tilde';
      const expectedResult = url;
      return expect(packageImporterInstance.cleanUrl(url)).to.equal(expectedResult);
    });

    it('should return the unmodified home path relative url', () => {
      const packageImporterInstance = new PackageImporterClass();
      const url = '~/home/path/with/tilde';
      const expectedResult = url;
      return expect(packageImporterInstance.cleanUrl(url)).to.equal(expectedResult);
    });

    it('should return a cleaned up url without tilde', () => {
      const packageImporterInstance = new PackageImporterClass();
      const url = '~path/with/tilde';
      const expectedResult = 'path/with/tilde';
      return expect(packageImporterInstance.cleanUrl(url)).to.equal(expectedResult);
    });
  });

  /** @test {PackageImporter#urlVariants} */
  describe('urlVariants()', () => {
    it('should be a function', () => {
      const packageImporterInstance = new PackageImporterClass();
      return expect(packageImporterInstance.urlVariants).to.be.a('function');
    });

    it('should return array with single url (module name)', () => {
      const packageImporterInstance = new PackageImporterClass();
      const url = 'module-name-url';
      const expectedResult = [url];
      return expect(packageImporterInstance.urlVariants(url)).to.deep.equal(expectedResult);
    });

    it('should return array with single url (specific file)', () => {
      const packageImporterInstance = new PackageImporterClass();
      const url = 'module-name/specific/file.scss';
      const expectedResult = [url];
      return expect(packageImporterInstance.urlVariants(url)).to.deep.equal(expectedResult);
    });

    it('should return array with partial file naming variants and extensions', () => {
      const packageImporterInstance = new PackageImporterClass();
      const url = 'module-name/partial/file';
      const expectedResult = [
        url,
        'module-name/partial/file.scss',
        'module-name/partial/_file.scss',
        'module-name/partial/file.sass',
        'module-name/partial/_file.sass'
      ];
      return expect(packageImporterInstance.urlVariants(url)).to.deep.equal(expectedResult);
    });
  });

  /** @test {PackageImporter#resolveFilter} */
  describe('resolveFilter()', () => {
    it('should be a function', () => {
      const packageImporterInstance = new PackageImporterClass();
      return expect(packageImporterInstance.resolveFilter).to.be.a('function');
    });

    it('should return package object with value from `sass` as value for `main`', () => {
      const packageImporterInstance = new PackageImporterClass();
      const pkg = {
        main: 'index.js',
        sass: 'sass.scss',
        scss: 'scss.scss'
      };
      const expectedResult = {
        main: 'sass.scss',
        sass: 'sass.scss',
        scss: 'scss.scss'
      };
      return expect(packageImporterInstance.resolveFilter(pkg)).to.deep.equal(expectedResult);
    });

    it('should return package object with value from `scss` as value for `main`', () => {
      const packageImporterInstance = new PackageImporterClass();
      const pkg = {
        main: 'index.js',
        scss: 'scss.scss'
      };
      const expectedResult = {
        main: 'scss.scss',
        scss: 'scss.scss'
      };
      return expect(packageImporterInstance.resolveFilter(pkg)).to.deep.equal(expectedResult);
    });
  });
});
